import React from "react";
import Menu from './Menu'
import '../styles/custom_services.css'

export default function Services(){
    return (
        <div>
            <Menu />
            <div className="ui container">
                <h1 className="services_h1">Our Services</h1>
                <p>
                Welcome to our services page! At Centur Healthcare Trading Corp, we're dedicated to providing top-notch services to meet your medical needs. From equipment provisioning to troubleshooting and supplying reagents, we offer comprehensive solutions tailored to your requirements. Whether you're a healthcare facility, laboratory, or medical professional, we're here to support you every step of the way. Explore our services below and discover how we can help you succeed.
                </p>
            </div>
        </div>
    )
}
